import React from 'react';
import './SoundStageList.css'; // Import the CSS file

function SoundStageList({ soundStages }) {
  if (!soundStages || soundStages.length === 0) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      {soundStages.map((stage, index) => (
        <div key={index}>
          <h2>{stage.studio_name}</h2>
          <h3>City: {stage.city}</h3>
          <h3>State: {stage.state}</h3>
          <h3>Country: {stage.country}</h3>
          <h3>Sound Stage: {stage.stage_number}</h3>
          <h4>Available Dates:</h4>
          <ul>
            <li>
              Start Date: {stage.start_date}
              {stage.end_date && <span>, End Date: {stage.end_date}</span>}
            </li>
          </ul>
        </div>
      ))}
    </div>
  );
}

export default SoundStageList;
